import React, { useState } from 'react'

import FeedAlgorithm from './components/FeedAlgorithm'


export default function SidebarRight() {
    const [page, setPage] = useState('FeedAlgorithm')

    const pages = {
        'FeedAlgorithm': <FeedAlgorithm />
    }

    return (
        <div className="sidebar p-0 b-left" style={{ right: '0' }}>
            {pages[page]}
            <div className="d-flex justify-content-center position-absolute bottom-0">
                <div className="rounded-circle p-2" style={{ background: 'var(--primary-color)', heigth: '5px', opacity: '1' }} />
                <div className="rounded-circle p-2" style={{ background: 'var(--primary-color)', heigth: '5px', opacity: '.5' }} />
                <div className="rounded-circle p-2" style={{ background: 'var(--primary-color)', heigth: '5px', opacity: '.5' }} />
            </div>
        </div>
    )
}
